import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Header = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', borderBottom: '20px solid black', borderLeft: '750px solid black', borderRight: '390px solid black', borderTop: '20px solid black', position: 'relative', height: '100px' }}>

      <Toolbar sx={{ display: 'flex', justifyContent: 'space-between', height: '20%' }}>
        <Typography variant="h6" component="div" sx={{ color: 'red' }}>
          Your Website
        </Typography>
        <div style={{ display: 'flex' }}>
          <Button color="success" sx={{ backgroundColor: 'yellow', borderBottom: '20px solid black', borderLeft: '99px solid pink', borderRight: '39px solid green', borderTop: '20px solid orange', position: 'relative', height: '100px' }}>Login</Button>
          <Button color="success" sx={{ backgroundColor: 'blue', borderBottom: '20px solid black', borderLeft: '90px solid black', borderRight: '30px solid black', borderTop: '20px solid gray', position: 'relative', height: '100px' }}>SignUp</Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
